release-it = "18.1.2"
rollup = "^4.32.1"
rollup-plugin-bundle-size = "^1.0.3"
serve = "^14.2.4"
terser = "^5.37.0"
ts-jest = "^29.2.5"
ts-json-schema-generator = "^2.3.0"
typescript = "~5.7.3"
vega-cli = "^5.31.0"
